import './App.css';

function App() {
  return (
    <div className="App">
        <div className="title">
          The Title
        </div>
        <div className="author">
          The Author
        </div>
        <ul className="stats">
          <li className="rating">
            5 stars
          </li>
          <li className="isbn">
            12-345678-910
          </li>
        </ul>
    </div>
  );
}

export default App;
